export function setLocations(list) {
  console.log(list,'list')
  return dispatch => {
    dispatch(setLocationsData(list))
  }
}

export function setLocationsData (list){
  return {
    list,
    type: "SET_LOCATION",
  };
}

export function setLoadiing (status){
  return {
    status,
    type: "SET_LOADING",
  };
}

export function addHistory (history){

  return {
    history,
    type: "SET_HISTORY",
  };
}

export function locationHistory (locationHistory){
  return {
    locationHistory,
    type: "LOCATION_HISTORY",
  };
}

